// import logo from './logo.svg';
import './App.css';
import React ,{ useEffect, useState } from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


import Food from './food';
import Header from './header'
import Banner from './banner'
import Footer from './footer'
import SearchNorth from './searchNorth'
import { Home } from '@material-ui/icons';
// import SearchPage from './searchNorth';


function App() {

  const [food,setFood] = useState([]);

  useEffect(()=>{
    getItem();
  },[])

  const getItem = async () =>{
    const response = await fetch(
      "http://localhost:9000/food"
    );
    const data = await response.json();
    console.log(data);
    setFood(data);
  }


  return (
    <Router>
      <div className="App">


        <Header/>

        <Switch>
          <Route path="/" exact>
            <Home/>
          </Route>
          <Route path="/north" exact>
            <SearchNorth/>
          </Route>

        <Banner className="banner"/>

        <h3>All available dishes : </h3>
           <div className="App-card">
            {food.map(food =>(
          <Food url={food.img_url} title={food.Fname} desc={food.descr} price={food.Fprice}/>
          ))}
        </div>
        </Switch>
        <Footer/>

      </div>
    </Router>
  );
}

export default App;
